  false,\n\t\"url\": null,\n\t\"notes\": \"Revealed preference models provide insights
  into recreational angler behavior and the economic value of recreational fishing
  trips.  Revealed preference data is typically collected by intercept and/or phone
  follow up calls.  Typical variables include length of the trip (day or overnight),
  household income, whether or not angler took time off of work, and primary purpose
  of overall trip. Sometimes trip expenditures are included as well. \",\n\t\"license_title\":
